{"title":"Water Fall [APM]","type":"vega","params":{"spec":"
{
  "$schema": "https://vega.github.io/schema/vega-lite/v2.json",
  "title": "Transaction WaterFall",
  "data": {
    "url": {
      "%context%": true,
      "%timefield%": "@timestamp",
      "index": "apm-6.5.1-span-tperf-pilot-*,apm-6.5.1-transaction-tperf-pilot-*",
      "body": {
        // Set the size to load 10000 documents
        size: 1000
      }
    },
    "format": {"property": "hits.hits"}
  },
  "transform": [
  
   {
      "calculate": "if((null != datum._source.span), datum._source.span.duration.us,datum._source.transaction.duration.us)/1000",
      "as": "duration"
    },

{ filter: "datum.duration > 3 " }  ,


    {
      "calculate": "toDate(datum._source.timestamp.us/1000)",
      "as": "start"
    },
    {
      "calculate": "toDate(if(if((null != datum._source.span), datum._source.span.duration.us  + datum._source.timestamp.us,datum._source.transaction.duration.us + datum._source.timestamp.us)>0,if((null != datum._source.span), datum._source.span.duration.us  + datum._source.timestamp.us,datum._source.transaction.duration.us + datum._source.timestamp.us),0)/1000)",
      "as": "end"
    },
    {
      "calculate": "if((null != datum._source.span), if ((null != datum._source.context.db ),substring(datum._source.context.db.statement,0,500) + ' / id / ' + datum._source.span.id ,datum._source.span.name),datum._source.transaction.name)",
      "as": "name"
    }
  ],
  "mark": "bar",
  "encoding": {
    "y": {"field": "name", "type": "nominal" ,"sort": {"op": "mean", "field": "start", "order" : "ascending"} },
    "x": {"field": "start", "type": "temporal", 
     axis: {format: '%H:%M:%S',"title": "horaire"}
     },
    "x2": {"field": "end", "type": "temporal"},
     "tooltip": [ {"field": "duration", "type": "quantitative"}]
     
      "color": {
    "condition": [
       { "test": "datum._source.transaction.name != null", "value": "blue" },
        {  "test": "datum._source.span!= null && datum._source.context.db != null", "value": "green" },
       {  "test": "datum._source.span!= null", "value": "red" },
       
    ],
    "value": "red"
  }
  
  }
}
"},"aggs":[]}
